INSERT INTO `posttable` (`id`, `year`, `date`, `title`, `author`, `content`, `month`, `private`) VALUES
(32, '2015', '2015-05-13 04:23:00', 'YEE HAAA. LETS REGISTER NOW', 'The Management', '<p style="text-align: justify;">\n	Hurry up!. We are open for membership registration. You can register now for free and be part of our big happy family. Take your 5 minutes and register now. Cheers</p>\n<p style="text-align: center;">\n	<a href="https://scontent-sin.xx.fbcdn.net/hphotos-xpt1/v/t1.0-9/11265251_1430951763889436_4496627063704695447_n.jpg?oh=474ca25c93e7f71e856abc298a47d572&amp;oe=560D3381"><img alt="" src="https://www.mishkahuniversity.com/wp-content/uploads/registernow1.png" style="width: 300px; height: 270px;" /></a></p>\n', 'May', 0),
(33, '2015', '2015-05-13 04:27:47', 'THE FEE?', 'The Management', '<p style="text-align: justify;">\n	Hai!. No worry . Our Entering Fee is just RM100 and the share is only RM1,000.00</p>\n<p style="text-align: center;">\n	<img alt="" src=" http://2.bp.blogspot.com/-Eg536BsFqTs/Tu9ShyWytLI/AAAAAAAAAhw/7Hgwd-BChjE/s400/Ownership.jpg" style="width: 300px; height: 300px;" /></p>\n<p>\n	 </p>\n', 'May', 0),
(34, '2015', '2015-05-13 04:38:26', 'BY-LAWS DOCUMENT UPLOADED', 'The Management', '<p>\n	Hai guys. Please read the entire pdf file. The documents is very important and need to be understand and follow. Thank ya</p>\n<p>\n	 </p>\n', 'May', 0),
(36, '2015', '2015-06-30 07:50:28', 'RAMADHAN AL-MUBARAK', 'The Management', '<p style="text-align: justify;">\n	Salam and Hai ,</p>\n<p style="text-align: justify;">\n	From The team of DC<br />\n	As the cresent moon is sighted... And the holy month of Ramadhan begins...May Allah bless you with happiness and grace your hom with warmth and peace<br />\n	<br />\n	<img alt="" src="http://cdn.muslimvillage.com/wp-content/uploads/2015/06/ramadan-forg.jpg" style="width: 474px; height: 318px;" /></p>\n', 'June', 0),
(37, '2015', '2015-06-30 08:09:12', 'MEMBERSHIP DATABASE IS READY', 'The Management', '<div style="text-align: justify;">\n	Salam Ramadhan,</div>\n<div style="text-align: justify;">\n	 </div>\n<div style="text-align: justify;">\n	Hai guys please be inform that the login system is ready and please login using your Identity Card Number and the default password is Dinarpal2015. Please log in now and change your password. For those who not yet register please click this link to <strong><a href="http://dinarpal.coop/main/registerPage">sign up</a> . </strong></div>\n<div style="text-align: justify;">\n	 </div>\n<div style="text-align: center;">\n	 </div>\n<div style="text-align: center;">\n	<img alt="" src="http://powerpictures.crystalgraphics.com/photo/sign_up_apply_now_red_icon_subscribe_here_membership_cg5p9503124c_th.jpg" style="width: 275px; height: 275px;" /></div>\n<div style="text-align: justify;">\n	 </div>\n<div style="text-align: justify;">\n	From Tech Team of DC</div>\n', 'June', 0),
(38, '2015', '2015-08-13 02:53:16', 'AR RAHNU APPROVAL ', 'The Management', '<p>\n	Salam and Hi guys !!!!</p>\n<p>\n	Alhamdullillah. We are happy to announce that our beloved COOP application for Ar-Rahnu business has been approved. We are on the mist of to setup the Ar-Rahnu International Prototype Premis in Melaka. Thanks ya</p>\n<p>\n	 </p>\n<p>\n	<img alt="" src="http://economictimes.indiatimes.com/photo/18703376.cms" style="width: 400px; height: 300px;" /></p>\n', 'August', 0),
(39, '2015', '2015-08-13 02:57:06', 'ANNUAL GENERAL MEETING', 'The Management', '<p>\n	Salam and Hi Guys !!</p>\n<p>\n	Please be inform that our Annual General Meeting will be conducted soon . So please login and get the details and might be login to COOP facebook group for further information</p>\n<p>\n	<img alt="" src="https://929c466ec8-custmedia.vresp.com/6deab5dde2/CLIPART_OF_15186_SM_2.jpg" style="width: 480px; height: 480px;" /></p>\n', 'August', 0),
(40, '2015', '2015-08-13 02:58:35', 'NATIONAL COOP DAY', 'The Management', '<p>\n	Salam and Hi Guys</p>\n<p>\n	Come on join us on this event. La La <img alt="" src="http://www.pns.com.my/wp-content/uploads/2015/08/Hari-Koperasi-2015-1024x738.jpg" style="width: 400px; height: 288px;" /></p>\n', 'August', 0);
